// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract InvestmentDashboard {
    uint public depositAmount;
    uint public withdrawAmount;

    function deposit(uint amount) public {
        require(amount > 0, "Deposit amount must be greater than zero.");
        depositAmount += amount;
    }

    function withdraw(uint amount) public {
        require(amount > 0, "Withdrawal amount must be greater than zero.");
        require(amount <= depositAmount, "Insufficient funds for withdrawal.");
        withdrawAmount += amount;
        depositAmount -= amount;
    }

    function getDepositAmount() public view returns (uint) {
        return depositAmount;
    }

    function getWithdrawAmount() public view returns (uint) {
        return withdrawAmount;
    }
}
